import React from 'react';
import "./Map.css";
import GoogleMapReact from 'google-map-react';

export default function Map() {
    const [mapCenter, setMapCenter] = React.useState({ lat: 32.88014427419814, lng: -117.2368479668978 });
    const [mapZoom, setMapZoom] = React.useState(13);
    return (
        <div className="Map">
            <GoogleMapReact
                bootstrapURLKeys={{ key: "AIzaSyCnasDuC3M7MHKCLlxqXU3vyJnzKAnwBTw" }}
                defaultCenter={mapCenter}
                defaultZoom={mapZoom}
            ></GoogleMapReact>
        </div>
    )
}
